    public LR_1(int[] array){
        this.arr=array;
    }
    public LR_1(int[] array1, int[] array2){
        this.arr = new int[array1.length+array2.length];
        System.arraycopy(array1, 0,arr,0,array1.length);
        System.arraycopy(array2,0,arr,array1.length,array2.length);
    }
    public int indexOfMin(){
        int min = arr[0];
        int index = 0;
        for (int i = 0; i < arr.length; i++) {
            if (min > arr[i])
            {
                min = arr[i];
                index = i;
            }
        }
        return index;
    }
    public int indexOfMax(){
        int max = arr[0];
        int index = 0;
        for (int i = 0; i < arr.length; i++) {
            if (max < arr[i]){
                max = arr[i];
                index = i;
            }
        }
        return index;
    }
    public int task1(int firstIndex, int secondIndex){
        int find = arr[firstIndex] + arr[secondIndex];
        int sum = 0;
        for (int i = 0; i < arr.length; i++) {
            if (arr[i] == find){
                sum += arr[i];
            }
        }
        return sum;
    }
    public int task2(){
        int sum = 0;
        for (int i = 0; i < arr.length; i++) {
            if (arr[i]>0){
                sum += arr[i];
            }
        }
        return sum;
    }
    public void inputArray(){
        Scanner input = new Scanner(System.in);
        System.out.println("Input array size:");
        int size = input.nextInt();
        this.arr= new int[size];
        for (int i = 0; i < size; i++) {
            arr[i]=input.nextInt();
        }
        input.close();
    }
    public void print(){
        System.out.println(Arrays.toString(this.arr));
    }
    public int getArrElByIndex(int index){
        return this.arr[index];
    }

